  true,\n\t\"url\": null,\n\t\"notes\": \"The Catalog of Federal Domestic Assistance
  is a government-wide compendium of Federal programs, projects, services, and activities
  that provide assistance or benefits to the American public. It contains financial
  and nonfinancial assistance programs administered by departments and establishments
  of the Federal government. CFDA provides a full listing of all Federal programs
  available to State and local governments (including the District of Columbia); federally-recognized
  Indian tribal governments; Territories (and possessions) of the United States; domestic
  public, quasi- public, and private profit and nonprofit organizations and institutions;
  specialized groups; and individuals. This dataset contains all active programs in
  CFDA and is updated weekly.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
